import React from "react";
import { Button, Col } from "react-bootstrap";
import 'frontend\src\components\layout\LoginLayout\LoginLayout.css'

function ButtonSocials(prop){
    return (
        <Col xs={3} className="text-center ">
            <Button className={`bg-dark w-100 container-socials`}><h1>{prop.label}</h1></Button>
        </Col>
    )
}

export default ButtonSocials
